print(n==p*q)

phi=(p-1)*(q-1)
d=libnum.invmod(e,phi)
d=gmpy2.invert(e,phi)
m1=pow(c,d,n)
print(m1)


#m=m1*inmod(-1,p)%p
m=m1*libnum.invmod(-1,p)%p
m=pow(m1*libnum.invmod(-1,p),1,p)
